column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli bisa menerima data konfigurasi JSON langsung atau suatu nama berkas yang memuat konfigurasi. Dalam kasus kedua, berkas dimuat dan isinya diletakkan ke dalam properti ini.

Contoh: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
        set team.config /etc/my-team.conf

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
Cara pakai: nmcli device set { ARGUMEN | help }

ARGUMEN := PERANGKAT { PROPERTI [ PROPERTI ... ] }
PERANGKAT := [ifname] <ifname> 
PROPERTYI := { autoconnect { yes | no } |
             { managed { yes | no }

Mengubah properti perangkat.

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Cara pakai: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<nama host>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
Cara pakai: nmcli general status { help }

Menampilkan status keseluruhan dari NetworkManager.
'status' adalah aksi baku, yang berarti 'nmcli gen' memanggil 'nmcli gen status'

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Cara pakai: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Cara pakai: nmcli radio { PERINTAH | help }

PERINTAH := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Cara pakai: nmcli radio all { ARGUMEN | help }

ARGUMEN := [on | off]

Mendapatkan status semua saklar radio, atau menyalakan/mematikan mereka.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Cara pakai: nmcli radio wifi { ARGUMEN | help }

ARGUMEN := [on | off]

Mendapatkan status saklar radio Wi-Fi, atau menyalakan/mematikannya.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Cara pakai: nmcli radio wwan { ARGUMEN | help }

ARGUMEN := [on | off]

Mendapatkan status saklar radio data seluler, atau menyalakan/mematikannya.
